import { Component ,Input} from '@angular/core';

@Component({
  selector: 'app-experience',
  templateUrl: './experience.component.html',
  styleUrls: ['./experience.component.css']
})
export class ExperienceComponent {
  @Input() experienceLogo: any;
  @Input() experienceHead: any;
  @Input() experienceDescription1: any;
  @Input() experienceDescription2: any;
}
<div class="experience">
    <img src="{{experienceLogo}}" alt="logo" style="float: left;padding: 2%;">
    <h3>{{experienceHead}}</h3>
    <p>&bull;{{experienceDescription1}}</p>
    <p>&bull;{{experienceDescription2}}</p>
    <hr>
    <img src="../../assets/images/edit-2.png" style="float: right;">
</div>
